import React, { Component } from "react";

class Error extends Component {
  componentDidMount() {}
  render() {
    return (
      <div className="error">
        <h1>404</h1>
        <h2>Curious One Aren't You ;)</h2>
        <h2>The Requested Page {this.props.page}</h2>
        <button onClick={() => this.props.navigate("home", 0)}>
          Go Back To The Site!
        </button>
      </div>
    );
  }
}

export default Error;
